import React from "react";

class GithubProfileCard extends React.Component{
    constructor(props) {
        super(props);

    }

    render() {
        let {name, avtar_url, bio, html_url} = this.props.profile;
         return (
            <div>
                <h2>{JSON.stringify(this.props.profile)}</h2>
            </div>
        );
    }
}
export default GithubProfileCard;
